import React from "react";
// import logo from './logo.svg';
import './App.css';
import UserList from './components/Users.js'
import axios from "axios";

class App extends React.Component{

  constructor(props) {
    super(props);
    this.state = {
      'users': []
    }
  }

  componentDidMount() {
       const users = [
           {
               'username': 'Фёдор',
               'first_name': 'Фёдор',
               'last_name': 'Достоевский',
               'email': 1821
           },
           {
               'username': 'Александр',
               'first_name': 'Александр',
               'last_name': 'Грин',
               'email': 1880
           },
       ]
       this.setState(
           {
               'users': users
           }
       )
   }

  render() {
    return(
        <div>
          <UserList users={this.state.users} />
        </div>
    )
  }
}

export default App;
